ging'=>'Debugging','Import events with Event Aggregator'=>'Evenementen importeren met Event Aggregator','Title for the editing section of the general settings.Editing'=>'Bewerken','Title for the viewing section of the general settings.Viewing'=>'Bekijken','If you’re enjoying The Events Calendar, give us kudos by including a link in the footer of calendar views. It really helps us a lot.'=>'Als je geniet van The Events Calendar, geef ons dan een pluim door een link op te nemen in de footer van agenda weergaven. Het helpt ons echt enorm.','Troubleshoot'=>'Probleemoplossen','Having trouble?'=>'Heb je problemen?','Getting started guide'=>'Aan de slag handleiding','Documentation'=>'Documentatie','Text for link to the add-ons page.Check out the available add-ons.'=>'Bekijk de beschikbare add-ons.','%1$sThe Events Calendar comes with a default API key for basic maps functionality. If you’d like to use more advanced features like custom map pins or dynamic map loads, you’ll need to get your own %2$sGoogle Maps API key%3$s.%4$s'=>'%1$sThe Events Calendar wordt geleverd met een standaard API-sleutel voor basis toewijzing functionaliteit. Als je meer geavanceerde functies wil gebruiken, zoals aangepaste kaart spelden of dynamisch laden van kaarten, moet je je eigen %2$sGoogle Maps API-sleutel%3$s.%4$s krijgen','Advanced Google Maps functionality'=>'Geavanceerde Google Maps functionaliteit','Get Event Tickets to manage attendee registration and ticket sales to your events, for free.'=>'Ontvang evenement tickets om de registratie van deelnemers en de kaartverkoop voor je evenementen gratis te beheren.','Start selling tickets to your events'=>'Start met de verkoop van tickets voor je evenementen','Enter the format to use for displaying dates with the year. Used when showing an event from a future year. Example: %1$s'=>'Voer het format in die je wil gebruiken voor het weergeven van datums met het jaar. Wordt gebruikt bij het tonen van een evenement uit een volgend jaar. Voorbeeld: %1$s','Default Styles'=>'Standaard stijlen',' Check out our <a href="%s" rel="noopener" target="_blank">customization guide</a> for instructions on template modifications.'=>' bekijk onze <a href="%s" rel="noopener" target="_blank">aanpassing gids</a> voor instructies over template wijzigingen.','The text label for the Month View.Month'=>'Maand','The text label for the List View.List'=>'Lijst','The text label for the Day View.Day'=>'Dag','The default title text for the today button.Click to select today\'s date'=>'Klik om de datum van vandaag te selecteren','The default text for the \'today\' button\'s title and aria-label on the Week View.Click to select the current month'=>'Klik om de huidige datum te selecteren','The default text label for the "today" button on the Month View.This Month'=>'Deze maand','Dates set using the start_date/end_date, starts_*/ends_* are set to start at the specified times. The default behavior is to include the entire days.'=>'Datums die zijn ingesteld met behulp van de start_date/end_date, starts_*/ends_* worden ingesteld om op de opgegeven tijden te beginnen. Het standaardgedrag is om de hele dagen op te nemen.','Events that end after the specified date'=>'Evenementen die na een opgegeven datum eindigen','Events that end before the specified date'=>'Evenementen die voor de opgegeven datum eindigen','Events that end on the specified date'=>'Evenementen die eindigen op de opgegeven datum','Events that start on the specified date'=>'Evenementen die starten op de opgegeven datum','Text label for control to hide restricted events on main calendar views.Hide restricted events on calendar views.'=>'Verberg beperkte afspraken in agenda weergaven.','The default text label for the "today" button on main calendar views.Today'=>'Vandaag','CSV File Formatting and Examples '=>'CSV bestand opmaak en voorbeelden ','Importing Calendar Data From a CSV File'=>'Agenda gegevens importeren uit een CSV bestand','Need assistance? You can find more