ion attempted'=>'Migratie poging gedaan','We detected an event that cannot be properly migrated. Please review the report below for more information. This issue must be resolved before you can migrate your site. Once you have updated or removed the problematic event, re-run the migration preview to make sure your site is ready to go.'=>'We hebben een evenement gedetecteerd die niet correct kan worden gemigreerd. Bekijk het onderstaande rapport voor meer informatie. Dit probleem moet worden opgelost voordat je je site kan migreren. Zodra je de problematische evenement hebt verwijderd, voer je de migratie voorbeeld opnieuw uit om er zeker van te zijn dat je site klaar is voor gebruik.','Your site could not be safely migrated to the new events system.'=>'Je site kan niet veilig worden gemigreerd naar het nieuwe evenementen systeem.','Migration failure'=>'Migratie mislukking','Okay'=>'Oké','Migration reversed'=>'Migratie teruggedraaid','Migration canceled'=>'Migratie geannuleerd','View the migration report'=>'Het migratierapport bekijken','The event %s generated an unknown error. Please try again or check out our %sTroubleshooting%s tips.'=>'Het evenement %s heeft een onbekende fout gegenereerd. Probeer het opnieuw of bekijk onze %sTroubleshooting%s tips.','The event %s generated an error: Cannot enqueue action to check migration status. Your site may be under high load and unable to process the necessary requests. Try again when site activity is low.'=>'Het evenement %s heeft een fout gegenereerd: kan geen actie uitvoeren om de migratie status te controleren. Je site wordt mogelijk zwaar belast en kan de benodigde aanvragen niet verwerken. Probeer het opnieuw wanneer de site activiteit laag is.','The event %s generated an error: Cannot enqueue action to migrate Event with post ID %s. Your site may be under high load and unable to process the necessary requests. Try again later.'=>'Het evenement %s heeft een fout gegenereerd: kan geen actie uitvoeren om gebeurtenis te m