e annuleren','Your events are being migrated to the new system. During migration, %1$syou cannot make changes to your calendar or events.%2$s Your calendar will still be visible on the frontend.'=>'Je evenementen worden gemigreerd naar het nieuwe systeem. Tijdens de migratie kan %1$sje geen wijzigingen aanbrengen in je agenda of afspraken.%2$s je agenda is nog steeds zichtbaar op de frontend.','Migration in progress'=>'Migratie in uitvoering','(Estimated time: %1$s minutes)'=>'(Geschatte tijd: %1$s minuten)','(Estimated time: %1$s minute)'=>'(Geschatte tijd: %1$s minuut)','Start migration'=>'Start migratie','Total events previewed:'=>'Totaal aantal bekeken evenementen:','Preview completed'=>'Voorbeeld afgerond','Your system doesn\'t allow us to run a preview, but you can still try a migration. During migration, %1$syou will not be able to create, edit, or manage your events.%2$s Your calendar will still be visible on your site.'=>'Je systeem staat ons niet toe om een voorbeeld uit te voeren, maar je kunt nog steeds een migratie proberen. Tijdens de migratie kan %1$sje geen evenementen aanmaken, bewerken of beheren.%2$s je agenda is nog steeds zichtbaar op je site.','From this preview, we estimate that the full migration process will take approximately %3$d minutes. During this time, %1$syou will not be able to create, edit, or manage your events.%2$s Your calendar will still be visible on your site.'=>'Op basis van dit voorbeeld schatten we dat het volledige migratie proces ongeveer %3$d minuten zal duren. Gedurende deze tijd kan %1$sje geen evenementen maken, bewerken of beheren.%2$s je agenda is nog steeds zichtbaar op je site.','The migration preview is done and ready for your review. No changes have been made to your events, but this report shows what adjustments will be made during the migration to the new system. If you have any questions, please %1$sreach out to our support team%2$s.'=>'Het migratie voorbeeld is gedaan en klaar voor je beoordeling. Er zijn ge