vents Bar icon color setting label.Icons'=>'Pictogrammen','The "Find Events" button text color setting label.Find Events Button Text'=>'Tekst van de knop evenementen zoeken','The events bar text color setting label.Text Color'=>'Tekstkleur','The header for the color control section.Adjust Appearance'=>'Weergave aanpassen','Note about what these settings control.These settings control the search and options bar that appears above calendar views.'=>'Deze instellingen bepalen de zoek- en optiebalk die boven de agendaweergaven wordt weergegeven.','Events Bar'=>'Evenementen balk','News from The Events Calendar'=>'Nieuws uit The Events Calendar','Effortlessly fill your calendar with events from Meetup, Eventbrite, iCal, Google Calendar, and more.'=>'Vul je agenda moeiteloos met evenementen van Meetup, Eventbrite, iCal, Google Calendar en meer.','Import events with ease'=>'Eenvoudig evenementen importeren','Events Aggregator'=>'Evenementen aggregator','The Events Calendar, Event Tickets and their add-ons integrate with other online tools and services to bring you additional features. Use the settings below to connect to third-party APIs and manage your integrations.'=>'De Events Calendar, Event Tickets en hun add-ons integreren met andere online gereedschap en diensten om je extra functies te bieden. Gebruik de instellingen hieronder om verbinding te maken met externe APIs en je integraties te beheren.','The Events Calendar does not send any user data outside of your website by default.'=>'De Evenementenkalender stuurt standaard geen gebruikersgegevens buiten je site.','Create Eventbrite tickets and events right from your WordPress dashboard.'=>'Maak Eventbrite tickets en evenementen rechtstreeks vanuit je WordPress dashboard.','Enable 3rd party event submissions.'=>'Schakel inzendingen van evenementen van derden in.','Allow users to search for events by category, tag, venue, organizer, day of the week, time of day, and price.'=>'Gebruikers toestaan om te zoeken naar evenementen op categorie, tag, locatie, organisator, dag van de week, tijdstip en prijs.','Email marketing to promote your events'=>'E-mailmarketing om je evenementen te promoten','Collect RSVPs and sell tickets'=>'Verzamel RSVPs en verkoop tickets','Import events from Meetup, Eventbrite, iCal, Google Calendar, and more.'=>'Importeer gebeurtenissen uit Meetup, Eventbrite, iCal, Google Agenda en meer.','The #1 calendar for WordPress'=>'De #1 kalender voor WordPress','There are a few %s to resolve and prevent 404 errors.'=>'Er zijn een paar %s om 404 fouten op te lossen en te voorkomen.','I keep getting “Page Not Found” on events.'=>'Ik krijg steeds \'Pagina niet gevonden\' over evenementen.','%s and other common installation issues.'=>'%s en andere veelvoorkomende installatieproblemen.','I installed the calendar and it crashed my site.'=>'Ik installeerde de kalender en het crashte mijn site.','This can happen when other plugins try to improve performance. %s.'=>'Dit kan gebeuren wanneer andere plugins proberen de prestaties te verbeteren. %s.','My calendar doesn’t look right.'=>'Mijn agenda ziet er niet goed uit.','Here’s an overview of %s and what they mean.'=>'Hier is een overzicht van %s en wat ze betekenen.','Common Error Messages'=>'Veelvoorkomende fout berichten','Check for updates'=>'Controleren op updates','It\'s important to use the most recent versions of our plugins so that you have access to the latest features, bug fixes, and security updates. Plugin functionality can be comprimised if your site is running outdated or mis-matched versions.'=>'Het is belangrijk om de meest recente versies van onze plugins te gebruiken, zodat je toegang hebt tot de nieuwste functies, bugfixes en beveiligingsupdates. De functionaliteit van de plugin kan in het gedrang komen als je site verouderde of niet-overeenkomende versies gebruikt.','Plugin(s) are out of date'=>'Plugin(s) zijn verouderd','Enter a custom API key'=>'Een aangepaste API-sleutel invoeren','The Events Calendar comes with an API key for basic maps functionality. If you’d like to use more advanced features like custom map pins, dynamic map loads, or Events Calendar Pro\'s Location Search and advanced Map View, you’ll need to get your own Google Maps API key and add it to Events > Settings > Integrations'=>'De Events Calendar wordt geleverd met een API-sleutel voor basiskaart functionaliteit. Als je meer geavanceerde functies wilt gebruiken, zoals aangepaste kaart spelden, dynamische kaart ladingen of de locatie zoekfunctie van Events Calendar Pro en geavanceerde kaartweergave, moet je je eigen Google Maps API-sleutel krijgen en deze toevoegen aan Evenementen > Instellingen > Integraties','Default Google Maps API key'=>'Standaard Google Maps API-sleutel','Manage your licenses'=>'Je licenties beheren','License keys can only be used on a limited number of sites, which varies depending on your license level. You\'ll need to remove the license from one or more other site\'s in order to use it on this one.'=>'Licentiesleutels kunnen alleen op een beperkt aantal sites worden gebruikt, wat varieert afhankelijk van je licentieniveau. Je moet de licentie van een of meer andere sites verwijderen om deze op deze te kunnen gebruiken.','Install max has been reached'=>'Installatie max is bereikt','Adjust your timezone'=>'Pas je tijdzone aan','When using The Events Calendar, we highly recommend that you use a geographic timezone such as "America/Los_Angeles" and avoid using a UTC timezone offset such as “UTC+9”. Choosing a UTC timezone for your site or individual events may cause problems when importing events or with Daylight Saving Time. Go to your the General WordPress settings to adjust your site timezone.'=>'Wanneer je The Events Calendar gebruikt, raden we je ten zeerste aan om een geografische tijdzone te gebruiken zoals "America/Los_Angeles" en een UTC tijdzone verschuiving zoals "UTC+9" te vermijden. Het kiezen van een UTC tijdzone voor je site of individuele evenementen kan problemen veroorzaken bij het importeren van evenementen of met zomertijd. Ga naar je de Algemene WordPress instellingen om de tijdzone van je site aan te passen.','Site time zone uses UTC'=>'Tijdzone van site maakt gebruik van UTC','This extension allows you to add custom HTML content to the top of the Community submission form.'=>'Deze extensie staat je toe om aangepaste HTML inhoud toe te voegen aan de bovenkant van het community inzending formulier.','Display Custom HTML'=>'Aangepaste HTML weergeven','This extension allows you to hide the Organizers and Venues that a visitor has not created from the Community submission form.'=>'Deze extensie staat je toe om de organisatoren en locaties die een bezoeker niet heeft aangemaakt te verbergen van het community inzendformulier.','Hide Others’ Organizers and Venues'=>'Organisatoren en locaties van anderen verbergen','This extension adds the “Show Google Maps” and “Show Google Maps Link” checkboxes when creating a new Venue.'=>'Deze extensie voegt de selectievakjes "Google Maps weergeven" en "Google Maps link weergeven" toe bij het maken van een nieuwe locatie.','Add Google Maps Display and Link Options'=>'Google Maps Display en link opties toevoegen','This extension allows you to set default currency symbols for your users to choose from instead of having a plain text field.'=>'Met deze extensie kun je standaard valutasymbolen instellen waaruit je gebruikers kunnen kiezen in plaats van een veld met platte tekst.','Add Cost Currency Symbol'=>'Symbool kostenvaluta toevoegen','This extension will send an email to event organizers whenever a user registers for their event.'=>'Deze extensie stuurt een e-mail naar organisatoren van evenementen wanneer een gebruiker zich registreert voor hun evenement.','Organizer Notification Email'=>'Organisator e-mail melding','Displays the information collected by “attendee meta fields” in the WooCommerce order screens as well.'=>'Geeft ook de informatie weer die is verzameld door "deelnemer meta velden" in de WooCommerce bestelschermen.','Add Event & Attendee Info to WooCommerce Order Details'=>'Voeg evenement en deelnemersgegevens toe aan WooCommerce bestelgegevens','This extension shows a meta box with an API key on each Event with Ticket/RSVP.'=>'Deze extensie toont een meta box met een API-sleutel op elk evenement met Ticket/RSVP.','Per Event Check In API'=>'API voor inchecken per evenement','Adds a new settings panel in Events > Settings that gives more control over the ticket and rsvp emails that are sent to attendees after registration.'=>'Voegt een nieuw instellingenpaneel toe in Events > Instellingen dat meer controle geeft over het ticket en rsvp e-mails die na registratie naar deelnemers worden verzonden.','Ticket Email Settings'=>'E-mailinstellingen voor tickets','When it comes to paid tickets, these orders can be refunded through the e-commerce platform in use.'=>'Als het gaat om betaalde tickets, kunnen deze bestellingen worden terugbetaald via het eCommerce platform dat in gebruik is.','How do I process refunds for tickets?'=>'Hoe verwerk ik terugbetalingen voor tickets?','Yes! You can easily accomplish this task using the stock options and multiple ticket types available with Event Tickets.'=>'Ja! Je kunt deze taak gemakkelijk volbrengen met behulp van de aandelenopties en meerdere ticket types die beschikbaar zijn bij Event Tickets.','Can I have a seating chart associated with my tickets?'=>'Kan ik een zitplaats kaart aan mijn tickets koppelen?','You can sell tickets using our built-in e-commerce option, or upgrade to Event Tickets Plus to use ecommerce plugins such as WooCommerce.'=>'Je kunt tickets verkopen met behulp van onze ingebouwde eCommerce optie of upgraden naar Event Tickets Plus om eCommerce plugins zoals WooCommerce te gebruiken.','How Do I Set Up E-Commerce Plugins for Selling Tickets?'=>'Hoe stel ik eCommerce plugins in voor het verkopen van tickets?','We’ve put together a video tutorial showing how to create events with Tickets using our plugins. Click on the link in the link in the title to learn more.'=>'We hebben een video zelfstudie samengesteld die laat zien hoe je evenementen kunt maken met Tickets met behulp van onze plugins. Klik op de link in de link in de titel voor meer informatie.','How Do I create events with Tickets or RSVP’s?'=>'Hoe maak ik evenementen met tickets of RSVP\'s?','This extension is a collection of tweaks and snippets for The Events Calendar.'=>'Deze extensie is een verzameling tweaks en samenvattingen voor The Events Calendar.','The Events Calendar Tweaks'=>'De evenementenkalender tweaks','This extension replaces photo view with a tiled grid of cards featuring event images.'=>'Deze extensie vervangt de fotoweergave door een getegeld raster van kaarten met evenement afbeeldingen.','Alternative photo view'=>'Alternatieve fotoweergave','This extension adds a set of block patterns for events to the WordPress block editor.'=>'Deze extensie voegt een set blokpatronen voor evenementen toe aan de WordPress blok-editor.','Event block patterns'=>'Evenement blokpatronen','This extension creates a useful variety of WordPress widget areas (a.k.a. sidebars).'=>'Deze extensie creëert een nuttige verscheidenheid aan WordPress widget gebieden (ook wel zijbalken).','Calendar widget areas'=>'Agenda widget gebieden','Our plugins include many shortcodes that do everything from embedding the calendar...'=>'Onze plugins bevatten veel shortcodes die alles doen, van het insluiten van de agenda...','Where can I find a list of available shortcodes?'=>'Waar kan ik een lijst met beschikbare shortcodes vinden?','Use our free Event Tickets plugin to get started with tickets and RSVPs.'=>'Gebruik onze gratis Event Tickets plugin om aan de slag te gaan met tickets en RSVPs.','How do I sell tickets to events?'=>'Hoe verkoop ik tickets voor evenementen?','Events Calendar Pro runs alongside The Events Calendar and enhances...'=>'Events Calendar Pro loopt naast The Events Calendar en verbetert...','What do I get with Events Calendar Pro?'=>'Wat krijg ik met Events Calendar Pro?','No, but you can use event categories or tags to display certain events like having...'=>'Nee, maar je kunt evenement categorieën of tags gebruiken om bepaalde evenementen weer te geven, zoals...','Can I have more than one calendar?'=>'Kan ik meer dan één kalender hebben?','* Your system information will only be used by The Events Calendar support team. All information is stored securely. We do not share this information with any third parties.'=>'* Je systeemgegevens worden alleen gebruikt door het ondersteuningsteam van The Events Calendar. Alle informatie wordt veilig opgeslagen. Wij delen deze informatie niet met derden.','Yes, automatically share my system information with The Events Calendar support team*'=>'Ja, deel mijn systeemgegevens automatisch met het ondersteuningsteam van The Events Calendar*','Please opt-in below to automatically share your system information with our support team. This will allow us to assist you faster if you post in our help desk.'=>'Meld je hieronder aan om je systeeminformatie automatisch te delen met ons ondersteuningsteam. Dit stelt ons in staat om je sneller te helpen als je bericht in onze helpdesk.','Open a ticket'=>'Open een ticket','Included with our premium products'=>'Inbegrepen bij onze premium producten','Get support from humans'=>'Krijg steun van mensen','Recent template changes'=>'Recente template wijzigingen','Hey there... did you check out the %s'=>'Hallo daar... heb je de %s bekeken','Help page?'=>'Help pagina?','Sometimes things just don’t work as expected. We’ve created a wealth of resources to get you back on track.'=>'Soms werken dingen gewoon niet zoals verwacht. We hebben een schat aan middelen gecreëerd om je weer op het goede spoor te krijgen.','Troubleshooting'=>'Probleemoplossing','Providing the details of your calendar plugin and settings (located below) helps our support team troubleshoot an issue faster. %s'