ts Calendar is hier!','screenshot of updated calendar views'=>'schermafbeelding van geüpdatete kalenderweergaves','Go check out your new calendar designs! Each calendar view has been updated, so feel free to enable views you may not have been using. If necessary, you can revert back to the legacy calendar views in the Display tab of your Event Settings.'=>'Bekijk onze nieuwe kalenderontwerpen! Elke kalenderweergave werd geüpdatet dus schakel de weergaves die je nog niet gebruikte nu in. Indien nodig kan je terug naar de oudere kalenderweergaves in de Weergave tab van je Event instellingen.','You\'re all set!'=>'Je bent helemaal klaar!','Add me to the list'=>'Voeg me toe aan de lijst','Themer\'s Guide'=>'Themer\'s gids','link for connecting meetupConnect to Meetup'=>'Verbinding maken met Meetup','(do not override)'=>'(niet negeren)','Start date for Eventbrite Tickets is Required'=>'Startdatum voor Eventbrite tickets is vereist','Log into Meetup'=>'Log in bij Meetup','Please log in to enable event imports from Meetup.'=>'Log in om het importeren van evenementen vanuit Meetup mogelijk te maken.','Import events directly from a public Eventbrite.com URL. Please note that only Live events (i.e. published events) can be imported via URL.'=>'Importeer evenementen rechtstreeks vanaf een openbare Eventbrite.com URL. Houd er rekening mee dat alleen live evenementen (d.w.z. gepubliceerde evenementen) via URL kunnen worden geïmporteerd.','Enable WordPress Custom Fields on events in the classic editor.'=>'Schakel WordPress aangepaste velden in voor evenementen in de klassieke editor.','Enable the Gutenberg block editor interface for creating events.'=>'Schakel de Gutenberg blok-editor interface in voor het maken van evenementen.','To continue using The Events Calendar, please install the latest version of'=>'Om de evenementenkalender te blijven gebruiken, installeer je de nieuwste versie van','Upgrade'=>'Upgrade','Upgrade your calendar views'=>'Upgrade je agendaweergaven','Welcome to The Events Calendar!'=>'Welkom bij de evenementenkalender!','Choosing a UTC timezone for your site or individual events may cause problems when importing events or with Daylight Saving Time. %1$s'=>'Het kiezen van een UTC-tijdzone voor je site of individuele evenementen kan problemen veroorzaken bij het importeren van evenementen of met zomertijd. %1$s','When using The Events Calendar, we recommend that you use a geographic timezone such as "America/Los_Angeles" and avoid using a UTC timezone offset such as “%2$s”.'=>'Als je The Events Calendar gebruikt, raden we je aan een geografische tijdzone te gebruiken, zoals "America/Los_Angeles", en een UTC-tijdzone-offset te vermijden, zoals "%2$s".','%s scheduled.'=>'%s ingepland.','%s reverted to draft.'=>'%s teruggezet naar concept.','%s published privately.'=>'%s is privé gepubliceerd.','We recommend a 16:9 aspect ratio for featured images.'=>'We raden een afbeeldingverhouding van 16: 9 aan voor aanbevolen afbeeldingen.','The datepicker range definition when no events are found.Upcoming'=>'Aankomende','The datepicker label when the range start is now.Now'=>'Nu','Powered by'=>'Aangedreven door','And if you skip this, that\'s okay! %1$s will still work just fine.'=>'En als je dit overslaat, is dat oké! %1$s werkt nog steeds prima.','Hi, %1$s! This is an invitation to help our %2$s community. If you opt-in, some data about your usage of %2$s will be shared with our teams (so they can work their butts off to improve). We will also share some helpful info on events management, WordPress, and our products from time to time.'=>'Hallo, %1$s! Dit is een uitnodiging om onze %2$s community te helpen. Als je jezelf aanmeldt, worden sommige gegevens over je gebruik van %2$s gedeeld met onze teams (zodat ze hun best kunnen doen om te verbeteren). We zullen ook van tijd tot tijd nuttige informatie delen over evenementenbeheer, WordPress en onze producten.','We hope you love %1$s'=>'We hopen dat je van %1$s houdt','The associat