\'ll need to enter your license key here in order to have access to automatic updates when new versions are available.'=>'Als je een premium add-on hebt gekocht, moet je hier je licentiesleutel invoeren om toegang te krijgen tot automatische updates wanneer er nieuwe versies beschikbaar zijn.','Select the date format used for elements with minimal space, such as in datepickers.'=>'Selecteer het datum format dat gebruikt wordt voor elementen met minimale spaties, zoals in datumkiezers.','Compact date format'=>'Compact datum format','North Macedonia'=>'Noord Macedonië','The Action Logger will dispatch any logging message using the "tribe_log" action writing, by default, to the PHP error log.'=>'De Action Logger verzendt elk logbericht met behulp van de actie "	ribe_log", standaard naar het PHP foutenlog.','Action-based Logger'=>'Op actie gebaseerde logger','There’s a new version of %1$s available, but your license is expired. You’ll need to renew your license to get access to the latest version. If you plan to continue using your current version of the plugin(s), be sure to use a compatible version of The Events Calendar. %2$s'=>'Er is een nieuwe versie van %1$s beschikbaar, maar je licentie is verlopen. Je moet je licentie verlengen om toegang te krijgen tot de nieuwste versie. Als je van plan ben je huidige versie van de plugin(s) te blijven gebruiken, zorg er dan voor dat je een compatibele versie van The Events Calendar gebruikt. %2$s','Read more.'=>'Verder lezen.','Promoter'=>'Promotor','%s must be a valid URL.'=>'%s moet een geldige URL zijn.','Your update failed due to an incompatibility between the version (%1$s) of the %2$s you tried to update to and the version of %3$s that you are using. %4$s'=>'Je update is mislukt vanwege een incompatibiliteit tussen de versie (%1$s) van de%2$s waarnaar je probeerde te updaten en de versie van %3$s die je gebruikt. %4$s','State'=>'Staat','Writes'=>'Schrijft','Reads'=>'Gelezen','ORM arg'=>'ORM arg','Value'=>'Waarde','Key'=>'Sleutel','PHP Render Context'=>'PHP render context','Could not delete post with ID '=>'Kan bericht met ID niet verwijderen ','Close this dialog window'=>'Sluit dit dialoogvenster','Open the dialog window'=>'Open het dialoogvenster','OK'=>'OK','Confirm'=>'Bevestig','Close this modal window'=>'Sluit dit modale venster','Open the modal window'=>'Open het modale venster','Show Timezone'=>'Toon tijdzone','Event Date & Time'=>'Evenement datum & tijd','Event Categories'=>'Evenement categorieën ','Tags'=>'Tags','Event Venue'=>'Evenement locatie','Event Organizer'=>'Evenement Organisator','All day'=>'Gehele dag','Show Map'=>'Toon kaart','Enable Maps'=>'Kaarten inschakelen','Show Map Link'=>'Toon kaart link?','Show Map Link:'=>'Toon kaart link:','Show Map:'=>'Toon kaart:','Activate Block Editor for Events'=>'Activeer blok-editor voor Events','Add Button Text'=>'Knoptekst toevoegen','Event Organizers'=>'Evenement Organisatoren','Unknown Column '=>'Onbekende kolom ','There was an error building the record queue: '=>'Er is een fout opgetreden bij het samenstellen van de record wachtrij: ','(click here for details)'=>'(klik hier voor details)','Event Blocks'=>'Evenement blokken','Add Description...'=>'Beschrijving toevoegen...','F j'=>'j F','F j, Y'=>'j F Y','g:i a'=>'H:i','%s ago'=>'%s geleden','%s from now'=>'%s vanaf nu','Problem loading the block, please remove this block to restart.'=>'Probleem bij het laden van het blok. Verwijder dit blok om opnieuw op te starten.','Text Array'=>'Tekst array','Numeric Array'=>'Numerieke matrix','Show Custom Fields metabox'=>'Toon de metabox voor aangepaste velden','Stop current processes'=>'Stop huidige processen','The Asynchronous import process is faster and does not rely on WordPress Cron but might not work correctly in all WordPress installations, try switching to the Cron-based process for maximum compatibility.'=>'Het asynchrone importproces is sneller en is niet afhankelijk van WordPress Cron, maar werkt mogelijk niet correct in alle WordPress-installaties. Probeer over te schakelen naar het op Cron gebaseerde proces voor maximale compatibiliteit.','Import Process System'=>'Processysteem importeren','click here'=>'klik hier','If you want to stop and clear current asynchronous import processes %1$s.'=>'Als je de huidige asynchrone importprocessen %1$s wil stoppen en wissen.','Import from Eventbrite URL'=>'Importeer vanuit Eventbrite URL','to create your own free Google Maps API key.'=>'om je eigen gratis Google Maps API-sleutel te maken.','If you do not add your own API key, the built-in API key will always populate this field and some map-related functionality will be limited '=>'Als je je eigen API-sleutel niet toevoegt, zal de ingebouwde API-sleutel dit veld altijd vullen en is sommige kaartgerelateerde functionaliteit beperkt ','You are using The Events Calendar\'s built-in Google Maps API key.'=>'Je gebruikt de ingebouwde Google Maps API-sleutel van The Events Calendar.','<p>The Events Calendar comes with an API key for basic maps functionality. If you’d like to use more advanced features like custom map pins or dynamic map loads, you’ll need to get your own %1$sGoogle Maps API key</a>. %2$sRead More</a>.</p>'=>'<p>The Events Calendar wordt geleverd met een API-sleutel voor basiskaart functionaliteit. Als je geavanceerdere functies wilt gebruiken zoals aangepaste kaartpinnen of dynamische kaartladingen, moet je je eigen %1$sGoogle Maps API-sleutel</a> krijgen. %2$sLees meer</a>.</p>','to learn more about using it with The Events Calendar'=>'voor meer informatie over het gebruik ervan met de evenementenkalender','You are using a custom Google Maps API key.'=>'Je gebruikt een aangepaste Google Maps API-sleutel.','Cron-based'=>'Cron-gebaseerd','Asynchronous'=>'Asynchroon','Unsupported'=>'Niet ondersteund','Successfully stopped and cleared 1 asynchronous queue process.'=>'Asynchroon wachtrijproces gestopt en gewist.' . "\0" . 'Succesvol gestopt en %d asynchrone wachtrijprocessen gewist.','No asynchronous queue processes to clear.'=>'Geen asynchrone wachtrij processen om te wissen.','The event tag ID or name'=>'Tag ID of naam van het evenement','The event category ID or name'=>'Categorie ID of naam van het evenement','Events should be filtered by their post_parent being the specified one.'=>'Evenementen moeten worden gefilterd op hun bericht_parent als de opgegeven.','Include events with one of the post IDs specified in the array of CSV list, date filters will be ignored.'=>'Neem evenementen op met een van de bericht ID\'s die zijn opgegeven in de array van de CSV lijst, datumfilters worden genegeerd.','Unable to process this import - a breakage or conflict may have resulted in the import halting.'=>'Kan deze import niet verwerken - een afbreken of een conflict kan ertoe hebben geleid dat de import is gestopt.','Calendar of %s'=>'Kalender van %s','%s Views Navigation'=>'%s weergaven navigatie','%s Search and Views Navigation'=>'%s Zoeken en weergeven navigatie','If you have extended our plugin(s) to send data to a third-party service such as Eventbrite, Google Maps, or PayPal, user information may be passed to these external services. These services may be located abroad.'=>'Als je onze plugin(s) hebt uitgebreid om gegevens te verzenden naar een dienst van derden, zoals Eventbrite, Google Maps of PayPal, kan gebruikersinformatie worden doorgegeven aan deze externe diensten. Deze diensten kunnen in het buitenland zijn gevestigd.','Where We Send Your Data'=>'Waar we je gegevens heen sturen','Certain data may be exported or removed upon users’ requests via the existing Exporter or Eraser. Please note, however, that several “edge cases” exist in which we are unable to perfect the gathering and export of all data for your end users. We suggest running a search in your local database, as well as within the WordPress Dashboard, in order to identify all data collected and stored for your specific user requests.'=>'Bepaalde gegevens kunnen worden geëxporteerd of verwijderd op verzoek van gebruikers via de bestaande Exporter of Eraser. Houd er echter rekening mee dat er verschillende \'edge-cases\' zijn waarin we het verzamelen en exporteren van alle gegevens voor je eindgebruikers niet kunnen perfectioneren. We raden je aan een zoekopdracht uit te voeren in je lokale database en in het WordPress-dashboard om alle verzamelde en opgeslagen gegevens voor je specifieke gebruikersverzoeken te identificeren.','All information (data) is retained in the local database indefinitely, unless otherwise deleted.'=>'Alle informatie (gegevens) wordt voor onbepaalde tijd bewaard in de lokale database, tenzij anders verwijderd.','How Long You Retain this Data'=>'Hoelang je deze gegevens bewaard','We make use of certain APIs, in order to provide specific features.'=>'We gebruiken bepaalde API\'s om specifieke functies te bieden.','The Events Calendar suite offers the use of third-party API keys. The primary functions are to enhance the features we\'ve built in, some of which use Google Maps, PayPal, Eventbrite, and Meetup. These API keys are not supplied by The Events Calendar.'=>'De Events Calendar suite biedt het gebruik van API-sleutels van derden. De belangrijkste functies zijn het verbeteren van de ingebouwde functies, waarvan sommige Google Maps, PayPal, Eventbrite en Meetup gebruiken. Deze API-sleutels worden niet geleverd door The Events Calendar.','API Keys'=>'API-sleutels','When purchasing Eventbrite Tickets, attendee, purchaser, and order information are stored and managed by Eventbrite.'=>'Bij de aankoop van Eventbrite tickets wordt informatie over deelnemers, kopers en bestellingen opgeslagen en beheerd door Eventbrite.','Please note that to create new events through the Community Events submission form, a user must hold a website account on this domain. This information is retained in the local database. It is also possible to create events anonymously, if the site owner has this option enabled.'=>'Houd er rekening mee dat een gebruiker, om nieuwe evenementen te creëren via het formulier voor het indienen van community-evenementen, een site-account op dit domein moet hebben. Deze informatie wordt bewaard in de lokale database. Het is ook mogelijk om anoniem evenementen te creëren, als de site-eigenaar deze optie hebt ingeschakeld.','Eventbrite Ticket information: name, description, cost, type, quantity'=>'Eventbrite Ticket informatie: naam, beschrijving, kosten, type, hoeveelheid','Import origin data (URL from where events are being imported—such as Eventbrite, MeetUp, other compatible URL sources, and more, which can include similar or same data as listed above)'=>'Herkomstgegevens importeren (URL van waar evenementen worden geïmporteerd - zoals Eventbrite, MeetUp, andere compatibele URL-bronnen en meer, die vergelijkbare of dezelfde gegevens kunnen bevatten als hierboven vermeld)','All data present within a CSV or ICS file and external URLs (for events, venues, organizers, and tickets)'=>'Alle gegevens aanwezig in een CSV of ICS bestand en externe URL\'s (voor evenementen, locaties, organisatoren en tickets)','Importing Events, Venues, and Organizers:'=>'Evenementen, locaties en organisatoren importeren:','Event information: website, cost, description, date, time, image'=>'Evenementinformatie: site, kosten, beschrijving, datum, tijd, afbeelding','Organizer information: name, phone, website, email'=>'Gegevens van de organisator: naam, telefoon, site, e-mail','Venue information: name, address, city, country, state, postal code, phone, website, geographical coordinates (latitude and longitude)'=>'Locatie-informatie: naam, adres, stad, land, staat, berichtcode, telefoon, site, geografische coördinaten (lengte- en breedtegraad)','If you create, submit, import, save, or publish Event, Venue, or Organizer information, such information is retained in the local database:'=>'Als je informatie over evenementen, locaties of organisatoren maakt, indient, importeert, opslaat of publiceert, wordt dergelijke informatie bewaard in de lokale database:','Suggested text:'=>'Gesuggereerde tekst:','Through the usage of The Events Calendar, Events Calendar PRO, The Events Calendar Filter Bar, Eventbrite Tickets, and Community Events plugins, as well as our Event Aggregator Import service (contained within The Events Calendar plugin), information may be collected and stored within your website’s database.'=>'Door het gebruik van The Events Calendar, Events Calendar PRO, The Events Calendar Filter Bar, Eventbrite Tickets en Community Events plugins, evenals onze Event Aggregator Import dienst (opgenomen in The Events Calendar plugin), kan informatie worden verzameld en opgeslagen binnen de database van je site.','Event, Venue, and Organizer Information'=>'Informatie over evenement, locatie en organisator','What personal data we collect and why we collect it'=>'Welke persoonlijke gegevens we verzamelen en waarom we die verzamelen','This information is only for guidance and not to be considered as legal advice.'=>'Deze informatie is alleen bedoeld als richtlijn en mag niet worden beschouwd als juridisch advies.','Disclaimer:'=>'Disclaimer:','You should include the information below in the correct sections of you privacy policy.'=>'Je moet de onderstaande informatie opnemen in de juiste secties van je privacybeleid.','This information serves as a guide on what sections need to be modified due to usage of The Events Calendar and its Add-ons.'=>'Deze informatie dient als leidraad voor de secties die moeten worden gewijzigd vanwege het gebruik van de evenementenkalender en de add-ons.','Hello,'=>'Hallo,','The default event category for events imported via Eventbrite'=>'De standaard evenement categorie voor evenementen die zijn geïmporteerd via Eventbrite','The default post status for events imported via Eventbrite'=>'De standaard berichtstatus voor evenementen die zijn geïmporteerd via Eventbrite','Eventbrite Import Settings'=>'Eventbrite importeer instellingen','None'=>'Geen'