f any of our premium plugins (like %2$s). Pick up a license and you can post there directly and expect a response within 24-48 hours during weekdays.'=>'<strong>Ben je op zoek naar snellere hulp?</strong> We bieden %1$s met de koop van een van onze premium plugins (zoals %2$s). Koop een licentie en je kan hier direct je vraag plaatsen. Je kan een reactie binnen 24-48 uur verwachten tijdens werkdagen.','If you have tried the above steps and are still having trouble, you can post a new thread to our %s. Our support staff monitors these forums once a week and would be happy to assist you there.'=>'Als je na het uitvoeren van bovenstaande stappen nog steeds problemen hebt, kun je een nieuwe thread plaatsen in ons %s. Onze staff monitort deze forums één keer per week en assisteert je daar graag.','open-source forum on WordPress.org'=>'open-source forum op WordPress.org','<strong>Looking for more immediate support?</strong> We offer %s with the purchase of any of our premium plugins. Pick up a license and you can post there directly and expect a response within 24-48 hours during weekdays'=>'<strong>Zoek je snellere hulp?</strong> We bieden %s bij aankoop van een van onze premium plugins. Koop een licentie en je kan hier direct je vraag plaatsen. Je kan op werkdagen binnen 24-48 uur een reactie verwachten','premium support on our website'=>'premium ondersteuning op onze site','If you have tried the above steps and are still having trouble, you can post a new thread to our WordPress.org forums for %1$s or %2$s. Our support staff monitors these forums once a week and would be happy to assist you there. '=>'Als je bovenstaande stappen hebt geprobeerd en nog steeds problemen ondervindt, kun je een nieuwe thread plaatsen op onze WordPress.org-forums voor %1$s of %2$s. Onze medewerkers controleren deze forums eenmaal per week en helpen je graag. ','Events Tickets'=>'Evenementen tickets','Customizing the Events plugins'=>'Aanpassen van de evenementen plugins','%s: Code and guides for customizing your calendar in useful and interesting ways.'=>'%s: Code en handleidingen voor het aanpassen van je agenda op nuttige en interessante manieren.','Troubleshooting common problems'=>'Oplossen van veel voorkomende problemen','%s: Do you see an issue with your calendar? Go here first to find where it’s coming from and how to fix it.'=>'%s: Heb je een probleem met je kalender? Ga eerst hiernaartoe om uit te vogelen waar het vandaan komt en hoe je het kan oplossen.','Using stylesheets and page templates'=>'Met behulp van stylesheets en pagina templates','%s: An overview of the default templates and styles that are included in the plugin, as well as how to change them.'=>'%s: Een overzicht van de standaard templates en styles die zijn inbegrepen in de plugin. Ook kan je hier vinden hoe je deze kan aanpassen.','%s: Our most comprehensive outline for customizing the calendar to suit your needs, including custom layouts and styles.'=>'%s: ons meest complete overzicht voor het aanpassen van de kalender aan je behoeften, met inbegrip van aangepaste lay-outs en stijlen.','Features overview'=>'Functies','%s: A complete look at the features you can expect to see right out of the box as well as how to use them.'=>'%s: een volledige blik op de functies die je standaard kunt verwachten en hoe ze te gebruiken.','Settings overview'=>'Instellingen','%s: A thorough walkthrough of The Events Calendar and the settings that are available to you.'=>'%s: Een uitgebreide handleiding van Events Calendar en de instellingen die je kan aanpassen.','Support for The Events Calendar'=>'Ondersteuning voor The Events Calendar','We are committed to helping make your calendar spectacular and have a wealth of resources available, including a handy %s to get your calendar up and running.'=>'We doen ons uiterste best om je te helpen een spectaculaire kalender te maken. Er is een enorme hoeveelheid aan middelen beschikbaar om je hierbij te helpen, waaronder een handige %s om je kalender op stoom te brengen.','New User Primer'=>'Kickstarter voor nieuwe gebruikers','CSV Import Settings'=>'Instellingen voor importeren van CSV bestanden','Clear'=>'Duidelijk','Add another %s'=>'Nog een %s toevoegen','Create New %s'=>'Maak nieuw(e) %s','Unnamed %s'=>'Naamloos %s','Read more about our support policy'=>'Lees meer over ons ondersteuningsbeleid','Please note that all hands-on support is provided via the help desk. You can email or tweet at us… ​but we will probably point you back to the help desk 😄'=>'Let er op dat alle hands-on ondersteuning wordt geleverd via de helpdesk. Je kan ons e-mailen of tweeten... maar waarschijnlijk verwijzen we je weer terug naar de helpdesk 😄','%s. There are very few issues we haven’t seen and it’s likely another user has already asked your question and gotten an answer from our support staff. While posting to the help desk is open only to paid customers, they are open for anyone to search and review.'=>'%s. Er zijn maar weinig problemen die we nog niet eerder gezien hebben en de kans is klein dat er niet al een andere gebruiker is geweest die je vraag ook al heeft gesteld en een antwoord heeft gehad van ons ondersteuningsteam. Het plaatsen van nieuwe berichten in de helpdesk is alleen mogelijk voor betalende klanten, maar het zoeken naar en inzien van de huidige berichten is beschikbaar voor iedereen.','Test for a theme or plugin conflict'=>'Controleer of er sprake is van een thema- of pluginconflict','%s. Testing for an existing conflict is the best start for in-depth troubleshooting. We will often ask you to follow these steps when opening a new thread, so doing this ahead of time will be super helpful.'=>'%s. De beste start voor uitgebreide troubleshooting is het testen voor bestaande conflicten. In veel gevallen zullen we je vragen om deze stappen te volgen als je een nieuwe thread hebt aangemaakt, dus het uitvoeren van deze stappen op voorhand zal enorm nuttig zijn.','Check our Knowledgebase'=>'Kijk eens in onze Kennisbank',